import logo from "./logo.svg";
import "./App.css";

function App() {
  const name = "Thanh";
  const duc_cai = true;
  const array = ["red", "blue", "green", "anpla"];
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p>
          {name}-{duc_cai ? "duc" : "cai"}
        </p>
        {duc_cai && <p>Male</p>}
        <ul>
          {array.map(name =(
            <li style={{color}}>{name}</li>
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
